import pytest
from geodist.geo import GeoDist


class TestGeoDist:
    @staticmethod
    def test_polygon():
        coords = [(4.3466824, 50.8584046), (4.3371552, 50.8490306), (4.3429917, 50.8336379), (4.3488282, 50.8330958),
                  (4.3658226, 50.8409013), (4.3695992, 50.8473506), (4.3679684, 50.8526612), (4.3466824, 50.8584046)]
        lng, lat = 4.3821081, 50.8133681
        geo = GeoDist(coords)

        assert int(geo.distance(lng, lat)) == pytest.approx(3153)

    @staticmethod
    @pytest.mark.parametrize("radius, distance, within", [(1000, 1334, False), (2000, 335, False), (3000, 663, True)])
    def test_circle(radius, distance, within):
        coords = [(-77.120923, 39.056418)]
        lng, lat = -77.145146, 39.047193

        geo = GeoDist(coords, radius=radius)

        assert int(geo.distance(lng, lat)) == pytest.approx(distance)
        assert geo.within == within

